import './App.css';

class Register extends React.Component {
    render() {
        return (
            <div className="App">
                <form>
                    <span className="formtext"><Form /></span>
                        <input 
                        type="text" 
                        placeholder="Enter Company Name" 
                        required 
                        />
                        <button>Submit</button>
                </form>
            </div>
        );
    }
}

export default Register;
